import axios from "axios";
import React, { useReducer } from "react";
import { useState } from "react"
import { toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';
/* import {DatePickerComponent} from "@syncfusion/ej2-react-calendars";
import {TimePickerComponent} from "@syncfusion/ej2-react-calendars"; */
import { useNavigate } from 'react-router-dom';
toast.configure()
const Booking = () => {

    let navigate = useNavigate();

    const [order, setOrder] = useState({
        Model: "",
        CarName: "",
        contactno: "",
        Date: "",
        orderId: "",
        washerName: "",
        washpackId: "",
        address: ""

    });


    const changeHandler = e => {
        setOrder({ ...order, [e.target.name]: e.target.value });
    }




    const submitHandler = () => {
        axios.post('http://localhost:8083/order/addorder', order)
            .then(res => {
                if (res.status === 200)

                    alert('Success')


                else
                    Promise.reject()
            })
            .catch(err => alert('Something went wrong'))
    }





    return (
        <>

            <div className="formTop">
                <div className="formTitle">
                    <p className="c1">BOOK YOUR CAR WASH </p>
                </div>
            </div>
            <div>
                <div className="formDetails">
                    <form className="actualForm" onSubmit={submitHandler}>
                        <div style={{ marginBottom: "30px" }}>
                            <p className="formName">Booking Details</p>
                        </div>
                        <div className="formDateTime">
                            <input type="date" name="Date" onChange={changeHandler} />
                        </div>

                        <div style={{ marginBottom: "20px" }}>
                            <select className="contactDetails" name="washpackId" onChange={changeHandler} >
                                <option className="opt1">Service Types</option>
                                <option>Express Wash:Rs.600</option>
                                <option>Super Wash:Rs.800</option>
                                <option>Ultimate Wash:Rs.1000</option>
                                <option>The Wheel Deal:Rs.1200</option>
                            </select>
                        </div>
                        <div style={{ marginBottom: "30px" }}>
                            <p className="formName">CONTACT DETAILS</p>
                        </div>
                        <div >
                            <input className="contactDetails" type="text" name="washerName" onChange={changeHandler}
                                placeholder="Enter Your Full Name" /><br />
                            <input className="contactDetails" name="CarName" type="text" placeholder="Enter Your Car Name"
                                onChange={changeHandler} /><br />

                            <input className="contactDetails" type="text" name="Model"
                                placeholder="Enter Your Car Model" onChange={changeHandler} /><br />

                            <input type="text" className="contactDetails" name="contactno"
                                onChange={changeHandler}
                                placeholder="Enter Phone" /><br />

                            <textarea cols="30" className="contactDetailsTextArea" rows="2" type="text" name="address"
                                onChange={changeHandler}
                                placeholder="Your Address" />
                        </div>
                        <div className="Submit">
                            <input type="submit" className="btn btn-success" value="Submit" />
                        </div>
                    </form>
                </div>
            </div>
        </>
    )
}
export default Booking
